import React from "react";

function Detailorder(props) {
  const handleClose = () => props.setModal(false);

  return (
    <>
      {props.showDetail && (
        <div
          onClick={handleClose}
          style={{
            width: "100vh",
            height: "100vh",
            backgroundColor: "red",
            border: "1px solid red",
            right: 0,
            top: 0,
            bottom: 0,
            zIndex: 2,
            position: "fixed",
          }}
        >
          <h2>Detail Order USER</h2>
        </div>
      )}
    </>
  );
}

export default Detailorder;
